export default function NewCaseParams (state = {}, action) {
    const { type, payload } = action;

    switch (type) {
        case 'BUILD_CASE_PAYLOAD':
            return {...state , ...payload};
        case 'CASE_ADDED_SUCCESS':
            return {};
        default:
            return state;
    }
}
